/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(t,n,s){"use strict";var e=s(/*! @babel/runtime/helpers/interopRequireDefault */1);Object.defineProperty(n,"__esModule",{value:!0}),n.default=void 0;var a=e(s(/*! @babel/runtime/helpers/newArrowCheck */2)),r={kivaDocConfig:{title:"数据 Mock",path:"kiva-cli/data-mock",group:"kiva-cli",topNav:"kiva-cli",sortIndex:3},data:function(){return{content:'<h1><span>数据 Mock</span></h1>\n<blockquote>\n<p>0 配置，基于前端拦截，支持发布到静态站点的数据 mock 服务。</p>\n</blockquote>\n<section class="kiva-markdown-card"><h3><span>简单使用</span></h3>\n<p>Kiva 会自动扫描组件 mock 文件夹下的 js 文件，以 button 组件为例，如下目录结构：</p>\n<pre><code class="hljs" lang="text">your-path/hello-kiva/src/components\n├── button\n│   ├── src\n│   ├── demo\n│   ├── mock\n│   │   ├── list.js          // mock 接口\n│   │   └── detail.js        // mock 接口\n</code></pre>\n<p>Kiva 将会产生两条拦截规则， <code>/mock/button/list</code> 与 <code>/mock/button/detail</code>。</p>\n<p>一个完整的 mock js 文件有如下选项：</p>\n<table>\n<thead>\n<tr>\n<th>属性</th>\n<th>说明</th>\n<th>类型</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>method</td>\n<td>请求方法</td>\n<td><code>GET</code> <code>POST</code></td>\n<td><code>GET</code></td>\n</tr>\n<tr>\n<td>status</td>\n<td>响应状态</td>\n<td><code>success</code> <code>error</code></td>\n<td><code>success</code></td>\n</tr>\n<tr>\n<td>delay</td>\n<td>响应延时</td>\n<td><code>number</code></td>\n<td><code>0</code></td>\n</tr>\n<tr>\n<td>success</td>\n<td>成功返回值</td>\n<td><code>object</code> <code>function</code></td>\n<td></td>\n</tr>\n<tr>\n<td>error</td>\n<td>失败返回值</td>\n<td><code>object</code> <code>function</code></td>\n<td></td>\n</tr>\n</tbody>\n</table>\n<p>示例：</p>\n<pre><code class="hljs" lang="js"><span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n  <span class="hljs-attr">method</span>: <span class="hljs-string">&#x27;GET&#x27;</span>,          <span class="hljs-comment">// 可选 GET POST, 默认 GET</span>\n  <span class="hljs-attr">status</span>: <span class="hljs-string">&#x27;success&#x27;</span>,      <span class="hljs-comment">// 设置响应状态</span>\n  <span class="hljs-attr">delay</span>: <span class="hljs-number">3000</span>,            <span class="hljs-comment">// 设置多少毫秒后响应</span>\n  <span class="hljs-attr">success</span>: {              <span class="hljs-comment">// 设置成功的返回值</span>\n    <span class="hljs-attr">list</span>: [\n      title: <span class="hljs-string">&#x27;xxx&#x27;</span>,\n      <span class="hljs-attr">img</span>: <span class="hljs-string">&#x27;xxx&#x27;</span>,\n      <span class="hljs-attr">url</span>: <span class="hljs-string">&#x27;xxx&#x27;</span>,\n    ]\n  },\n  <span class="hljs-attr">error</span>: {                <span class="hljs-comment">// 设置失败的返回值</span>\n    <span class="hljs-attr">msg</span>: <span class="hljs-string">&#x27;something error&#x27;</span>,\n  },\n}\n</code></pre>\n</section><section class="kiva-markdown-card"><h3><span>深度定制</span></h3>\n<p>Kiva 集成了 <a href="http://mockjs.com/">mockjs</a> 方便开发者生成更真实的数据。</p>\n<p><code>success</code> <code>error</code> 支持深度自定义，当为 <code>function</code> 类型时，接收 3 个参数：</p>\n<ul>\n<li><code>req</code></li>\n<li><code>res</code></li>\n<li><code>Mock</code></li>\n</ul>\n<h4><span><code>req</code> 请求对象：</span></h4>\n<ul>\n<li><code>req.body</code> 请求体</li>\n<li><code>req.method</code> 请求方法</li>\n<li><code>req.originalUrl</code> 原始 url</li>\n<li><code>req.path</code> // <a href="http://example.com/users?sort=desc">example.com/users?sort=desc</a>  =&gt; \'/users\'</li>\n<li><code>req.protocol</code> 协议</li>\n<li><code>req.query</code> // <a href="http://example.com/users?a=1&amp;b=2">example.com/users?a=1&amp;b=2</a>   =&gt;  { a: 1, b: 2 }</li>\n</ul>\n<h4><span><code>res</code> 响应对象：</span></h4>\n<ul>\n<li><code>res.json</code> 返回 json 格式数据</li>\n<li><code>res.status</code> 设置响应状态码</li>\n<li><code>res.type</code> 设置响应 content-type</li>\n</ul>\n<h4><span><code>MOCK</code> 对象：</span></h4>\n<p><a href="http://mockjs.com/examples.html">Mock</a></p>\n<pre><code class="hljs" lang="js"><span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> {\n  <span class="hljs-attr">delay</span>: <span class="hljs-number">3000</span>,\n  success(req, res, Mock) {\n    <span class="hljs-keyword">const</span> { category } = req.query\n    res.json(Mock.mock({\n      <span class="hljs-comment">// 属性 list 的值是一个数组，含有 10 个元素</span>\n      <span class="hljs-string">&#x27;list|10&#x27;</span>: [\n        {\n          category,\n          <span class="hljs-attr">title</span>: <span class="hljs-string">&#x27;@cparagraph(1)&#x27;</span>, <span class="hljs-comment">// 随机生成一段中文文本</span>\n          <span class="hljs-attr">url</span>: <span class="hljs-string">&#x27;@url(&quot;http&quot;)&#x27;</span>,     <span class="hljs-comment">// 随机生成一个 URL</span>\n        }\n      ]\n    }))\n  },\n}\n</code></pre>\n</section>',anchors:[]}},mounted:function(){var t=this,n=Array.prototype.slice.call(this.$el.querySelectorAll("h2"));this.anchors=n.map(function(n){return(0,a.default)(this,t),{hash:n.id,title:n.innerText}}.bind(this)).filter(function(n){return(0,a.default)(this,t),n.hash&&n.title}.bind(this))},methods:{scrollToAnchor:function(t){var n=document.getElementById(t);n&&n.scrollIntoView({block:"start",behavior:"smooth"})}}};n.default=r},
