/*! ModuleConcatenation bailout: Module is not an ECMAScript module */function(t,n,s){"use strict";var e=s(/*! @babel/runtime/helpers/interopRequireDefault */1);Object.defineProperty(n,"__esModule",{value:!0}),n.default=void 0;var a=e(s(/*! @babel/runtime/helpers/newArrowCheck */2)),r={kivaDocConfig:{title:"使用",path:"kiva-cli/use",group:"kiva-cli",topNav:"kiva-cli",sortIndex:2},data:function(){return{content:'<h1><span>开始使用</span></h1>\n<h2 id="ru-he-shi-yong"><span>如何使用</span></h2>\n<section class="kiva-markdown-card"><h3><span>1. 创建新项目</span></h3>\n<p>可以手动，也可以使用命令创建新项目</p>\n<pre><code class="hljs" lang="bash">$ npx @wozjs/kiva-cli create hello-kiva\n\n<span class="hljs-comment"># 如果你是全局安装 @wozjs/kiva-cli</span>\n$ kiva create hello-kiva\n</code></pre>\n<p>生成如下文件：</p>\n<pre><code class="hljs" lang="text">your-path/hello-kiva\n├── docs\n│   ├── home.md\n│   └── quickstart.md\n├── kiva.config.js\n└── package.json\n</code></pre>\n<p>这里的文件都 kiva 来说都不是必须的，create 命令只是帮助生成简单的项目，并安装 kiva-cli 依赖而已。</p>\n<p>所以你也可以完全手动创建项目，并安装 kiva-cli 依赖。</p>\n<pre><code class="hljs" lang="bash"><span class="hljs-comment"># 使用 npm</span>\n$ npm install @wozjs/kiva-cli --dev\n\n<span class="hljs-comment"># 使用 yarn</span>\n$ yarn add @wozjs/kiva-cli --dev\n</code></pre>\n</section><section class="kiva-markdown-card"><h3><span>2.创建你自己的组件</span></h3>\n<p>Kiva 对目录及文件名有严格要求，组件必须位于 <code>src/components</code> 中，下面是组件 <code>button</code> 的示例：</p>\n<pre><code class="hljs" lang="text">your-path/hello-kiva/src/components\n├── button                // 组件名即目录名，中划线命名\n│   ├── src\n│   │   ├── index.vue     // 组件源码\n│   │   └── index.less    // 组件样式\n│   ├── demo\n│   │   └── index.vue     // demo 代码\n│   ├── mock\n│   │   └── api.js        // mock 接口\n│   ├── index.js          // 入口文件\n|   └── README.md         // 组件说明文档\n</code></pre>\n<p>创建上述文件后，我们在入口文件 <code>src/components/button/index.js</code> 中导出我们的组件：</p>\n<pre><code class="hljs" lang="js"><span class="hljs-comment">// src/components/button/index.js</span>\n<span class="hljs-keyword">import</span> KivaButton <span class="hljs-keyword">from</span> <span class="hljs-string">&#x27;./src/index.vue&#x27;</span>\n\nKivaButton.install = <span class="hljs-function"><span class="hljs-keyword">function</span>(<span class="hljs-params">Vue</span>) </span>{\n  Vue.component(KivaButton.name, KivaButton)\n}\n\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> KivaButton\n</code></pre>\n<p>手动进行上述操作有些麻烦，且容易出错，<strong>推荐使用 kiva-cli 生成新组件</strong>：</p>\n<pre><code class="hljs" lang="bash">$ kiva new component-name\n</code></pre>\n</section><section class="kiva-markdown-card"><h3><span>3. 开始开发</span></h3>\n<p>使用 <code>kiva serve</code> 启动开发服务，一切正常的话你将会看到一个包含 demo 与文档的站点。</p>\n<p>Kiva 实际上启动了两个服务：</p>\n<ul>\n<li>一个是文档站点 docs</li>\n<li>一个是 demo 示例站点</li>\n</ul>\n<p>他们是互相独立的，这意味着如果你只想专注于组件开发，只需新开一个窗口打开 demo 站点的地址即可。</p>\n<p>demo 站点与常规 Vue 项目没有什么不同，但是为了便于组件开发，Kiva会加一点私货：</p>\n<h4><span>3.1 全局注册你的所有组件</span></h4>\n<p>Kiva 默认已经将你的所有组件注册到全局，你可以直接方便地使用他们。</p>\n<p>上述例子中我们创建了一个名为 kiva-button 的组件，那么在任何一处的 demo 示例中，你都可以直接使用 kiva-button 来引用它。</p>\n<pre><code class="hljs" lang="vue"><span class="xml"><span class="hljs-tag">&lt;<span class="hljs-name">template</span>&gt;</span>\n  <span class="hljs-tag">&lt;<span class="hljs-name">kiva-button</span>&gt;</span>your button component<span class="hljs-tag">&lt;/<span class="hljs-name">kiva-button</span>&gt;</span>\n<span class="hljs-tag">&lt;/<span class="hljs-name">template</span>&gt;</span>\n</span></code></pre>\n<h4><span>3.2 基于前端拦截的数据 mock</span></h4>\n<p>仍以上述 kiva-button 为例，由于组件存在 <code>mock/api.js</code> 文件，所以 Kiva 会拦截 <code>/mock/button/api</code> 的 ajax 请求。而接口如何返回，由 <code>mock/api.js</code> 决定。</p>\n<h4><span>3.3 集成 axios</span></h4>\n<p>Kiva 已将 axios 挂载到 Vue 上，你可以在Vue 组件中使用 <code>this.$axios</code> 访问它。</p>\n<blockquote>\n<p>所以 <strong>Kiva 的工作依赖文件结构</strong>，请务必注意：<br>\n当我们运行 <code>kiva serve</code> 时，Kiva 会扫描 <code>src/components</code> 下符合规则的组件并做如下几件事：</p>\n<ol>\n<li>扫描组件的 <code>index.js</code> 入口文件，并将组件注册到全局</li>\n<li>扫描组件 <code>src/index.less</code>, 并引入样式文件</li>\n<li>扫描 demo 下的 index.vue，启动 demo app 服务，将该组件作注册为 demo app 的新路由</li>\n<li>扫描 <a href="http://README.md">README.md</a>, 启动docs app 服务，将 markdown 文件转换为 vue 并注册为 docs app 的新路由</li>\n<li>扫描 mock 文件下的 js 文件，拦截基于 XMLHttpRequest 的请求，拦截的接口地址为 <code>mock/组件名/mock下的js文件名</code></li>\n</ol>\n</blockquote>\n</section><section class="kiva-markdown-card"><h3><span>4. 组件打包及文档上传</span></h3>\n<pre><code class="hljs" lang="bash">$ kiva build all       <span class="hljs-comment"># 全量打包</span>\n$ kiva build component <span class="hljs-comment"># 按需加载打包</span>\n$ kiva build site      <span class="hljs-comment"># 文档静态站点打包</span>\n</code></pre>\n<p>全量打包将会在 dist 中生成 kiva-ui.common.js 与 kuva-ui.css文件</p>\n<p>按需加载打包会在 lib 中生成各个组件的代码</p>\n<p>静态站点打包会在 site 文件夹中生成文档及 demo 的静态页</p>\n<pre><code class="hljs" lang="bash">$ kiva deploy\n</code></pre>\n<p>将 site 中的文件上传到 ftp 服务器(需要在 <code>kiva.config.js</code> 中配置 ftp）</p>\n</section>',anchors:[]}},mounted:function(){var t=this,n=Array.prototype.slice.call(this.$el.querySelectorAll("h2"));this.anchors=n.map(function(n){return(0,a.default)(this,t),{hash:n.id,title:n.innerText}}.bind(this)).filter(function(n){return(0,a.default)(this,t),n.hash&&n.title}.bind(this))},methods:{scrollToAnchor:function(t){var n=document.getElementById(t);n&&n.scrollIntoView({block:"start",behavior:"smooth"})}}};n.default=r},
